import React, { useCallback } from "react";
import { useNavigate } from "react-router-dom";

const BackLine = () => {
  const history = useNavigate();

  const goBack = () =>
    useCallback(() => {
      return history.goBack();
    }, [history]);

  return (
    <div className="line-back">
      <button onClick={goBack}>
        <p>&larr;</p>
        <p>Back</p>
      </button>
    </div>
  );
};

export default BackLine;
